import React from "react";
import {
  ResponsiveContainer,
  ComposedChart,
  Line,
  XAxis,
  YAxis,
  Tooltip,
  CartesianGrid,
  Legend
} from "recharts";

function ResultPage({ results, importance, commitment, onReset }) {
  const topValue = results.feedback1[0] || "없음";
  const lowCommitValues = results.feedback2.length ? results.feedback2.join(", ") : "없습니다";

  return (
    <div style={{
      maxWidth: '800px',
      margin: '2rem auto',
      padding: '2rem',
      backgroundColor: '#fff',
      borderRadius: '12px',
      boxShadow: '0 0 20px rgba(0,0,0,0.05)',
      fontFamily: 'sans-serif'
    }}>
      <div style={{ textAlign: 'center', marginBottom: '2rem' }}>
        <h2 style={{ fontSize: '1.5rem', fontWeight: 'bold' }}>내 삶의 방향 찾기</h2>
      </div>

      <div style={{
        backgroundColor: '#000',
        color: '#fff',
        padding: '0.8rem',
        borderRadius: '8px',
        textAlign: 'center',
        marginBottom: '2rem',
        fontSize: '1.1rem',
        fontWeight: 600
      }}>
        나의 가치로운 삶 결과
      </div>

      {/* 그래프 컴포넌트 */}
      <div style={{ marginBottom: '2.5rem' }}>
        {/* 이곳에 그래프 컴포넌트 삽입 e.g., <RadarChart data={...}/> */}
      </div>

      {/* 점수 박스 */}
      <div style={{
        backgroundColor: '#f9f9f9',
        borderRadius: '16px',
        padding: '2rem',
        textAlign: 'center',
        boxShadow: '0 0 10px rgba(0,0,0,0.05)',
        marginBottom: '2rem'
      }}>
        <h3 style={{ fontSize: '1.1rem', color: '#555', marginBottom: '0.5rem' }}>내 가치로운 삶 점수</h3>
        <div style={{ fontSize: '2.8rem', fontWeight: 'bold', marginBottom: '1rem', color: '#222' }}>
          {results.score.toFixed(1)}
        </div>
        <p style={{ fontSize: '1rem', color: '#333', marginBottom: '1rem' }}>
          당신에게 중요한 중요한 가치는 <span style={{ color: '#9b59b6', fontWeight: 'bold' }}>{topValue}</span> 입니다.
        </p>
        <p style={{ fontSize: '1rem', color: '#333' }}>
          중요하지만 잘 실천하지 못하는 가치는{" "}
          <span style={{ color: '#9b59b6', fontWeight: 'bold' }}>{lowCommitValues}</span>입니다.{" "}
          {lowCommitValues === "없습니다" ? "모두 잘 실천하고 있는 편이네요." : ""}
        </p>
      </div>

      {/* 다시 시작 버튼 */}
      <div style={{ textAlign: 'center' }}>
        <button
          onClick={onReset}
          style={{
            padding: '0.8rem 2rem',
            backgroundColor: '#000',
            color: '#fff',
            borderRadius: '8px',
            fontSize: '1rem',
            border: 'none',
            cursor: 'pointer'
          }}
        >
          다시 해보기
        </button>
      </div>
    </div>
  );
}
